import React from 'react';
import {NavLink} from "react-router-dom";

const Home = () => {
    return (
        <div className="homeBlock">
            <h1>HOME</h1>

            <div className="map">
               <div className="bottomNav">
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Alle </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Fysiotherapie </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Oefenherapie </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Logopedie </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Ergotherapie </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Dietist </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Revalidatie </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Zorguitleen </NavLink></div>
                    <div className="iconsContainer"><NavLink to="/Professionals" className="bottomNavButtons"> Ziekenhuizen </NavLink></div>
                </div>
            </div>
        </div>
    )
}

export default Home;
